import React from 'react'

function ArcadeIntro() {
  return (
    <div className="arcade">
      <p className="arcade__p">
      Founder and president of the Coding Games Club at Yoobee. I started the club so students had a space to have fun and get creative with their coding, outside of assignments and ruberic statements.
      <br />
      When I first started learning Javascript I felt overwhelmed trying to understand its logic and structure. In an effort to get my head around parameters and methods, I started making little Javascript games in my spare time. These little games became the building blocks for my coding foundation!
      </p>
    </div>
  )
}

export default ArcadeIntro
